from collections import deque


class Solution:
    def maxDistance(self, grid) -> int:
        m = len(grid)
        n = len(grid[0])
        dp = [[float("inf") for _ in range(n)] for i in range(m)]

        def bfs(x, y, dis, dp, grid, visited):
            queue = deque()
            queue.append([x, y, dis])
            xs = [-1, 0, 0, 1]
            ys = [0, -1, 1, 0]
            while queue:
                i, j, dist = queue.popleft()

                visited.add((i, j))
                for k in range(4):
                    nx = i + xs[k]
                    ny = j + ys[k]

                    if 0 <= nx < m and 0 <= ny < n and (nx, ny) not in visited:
                        if (grid[nx][ny] == 0):
                            dp[nx][ny] = min(dp[nx][ny], dist + 1)
                            queue.append([nx, ny, dist + 1])

        for i in range(m):
            for j in range(n):
                if grid[i][j] == 1:
                    visited = set()
                    bfs(i, j, 0, dp, grid, visited)
        Max = 0
        for i in range(m):
            for j in range(n):
                if dp[i][j] != float("inf"):
                    Max = max(Max, dp[i][j])
        return Max if Max else -1


